message:
🇧🇷 — Vamos brincar de conjecturar um futuro hipotético:

— Manifestações crescendo, sobretudo em frente aos quartéis;

— Cenário econômico apreensivo e insatisfeito;

— Uma oposição liderada por um homem de visões esclarecidas espectralmente;

— Uma oposição à margem de liberais que pregam o pouco intervencionismo econômico;

— Um congresso majoritariamente composto pela Centro-Direita;

— 85% de todo PIB, juntamente com todos os governadores de Estado – com exceção de Rio Grande do Sul e Espírito Santo — sendo oposição ao governo.

✍️

⚙️Inscreva-se em @Armillary!
